import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './AddListing.css';

const EditListing = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [activeTab, setActiveTab] = useState('listings');
  const [formData, setFormData] = useState({
    streetAddress: '123 Main St.',
    city: 'Anytown',
    state: 'CA',
    zipCode: '90210',
    propertyType: 'Office',
    size: '5,000',
    floors: '2',
    yearBuilt: '2005',
    zoning: 'Commercial',
    parkingSpaces: '50',
    askingPrice: '$1,500,000',
    priceType: 'sale',
    description: 'This is a well-maintained commercial property in a prime location with excellent accessibility and modern amenities.',
    status: 'Active',
    amenities: {
      hvac: true,
      securitySystem: false,
      loadingDocks: true,
      highCeilings: false,
      renovated: true
    }
  });

  const [uploadedImages, setUploadedImages] = useState([
    // Mock existing images - in real app, these would come from the listing data
    { id: 1, name: 'property-front.jpg', url: 'https://images.unsplash.com/photo-1486406146926-c627a92ad1ab?w=400&h=300&fit=crop' },
    { id: 2, name: 'property-interior.jpg', url: 'https://images.unsplash.com/photo-1560472354-b33ff0c44a43?w=400&h=300&fit=crop' }
  ]);

  const [newImages, setNewImages] = useState([]);

  // Simulate loading existing listing data
  useEffect(() => {
    // In a real app, you would fetch the listing data by ID here
    console.log('Loading listing with ID:', id);
    // fetchListingData(id);
  }, [id]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleAmenityChange = (amenity) => {
    setFormData(prev => ({
      ...prev,
      amenities: {
        ...prev.amenities,
        [amenity]: !prev.amenities[amenity]
      }
    }));
  };

  const handlePriceTypeChange = (type) => {
    setFormData(prev => ({
      ...prev,
      priceType: type
    }));
  };

  const handleImageUpload = (e) => {
    const files = Array.from(e.target.files);
    setNewImages(prev => [...prev, ...files]);
  };

  const handleRemoveExistingImage = (imageId) => {
    setUploadedImages(prev => prev.filter(img => img.id !== imageId));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form updated:', formData);
    console.log('Existing images:', uploadedImages);
    console.log('New images:', newImages);
    // Add your update logic here
    // In a real app, you would send the updated data to your API
  };

  const handleCancel = () => {
    navigate('/dashboard/listings');
  };

  return (
    <div className="add-listing">
      <Header />
      <div className="dashboard-container">
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
        <main className="main-content">
          <div className="content-header">
            <h1 className="main-title">Edit Listing</h1>
          </div>
          
          <div className="add-listing-content">
            <form onSubmit={handleSubmit} className="add-listing-form">
              <div className="form-section">
                <h2 className="section-title">Property Location Details</h2>
                <div className="form-grid">
                  <div className="form-group">
                    <label htmlFor="streetAddress">Street Address</label>
                    <input
                      type="text"
                      id="streetAddress"
                      name="streetAddress"
                      value={formData.streetAddress}
                      onChange={handleInputChange}
                      className="form-input"
                    />
                  </div>
                  <div className="form-group">
                    <label htmlFor="city">City</label>
                    <input
                      type="text"
                      id="city"
                      name="city"
                      value={formData.city}
                      onChange={handleInputChange}
                      className="form-input"
                    />
                  </div>
                  <div className="form-group">
                    <label htmlFor="state">State</label>
                    <input
                      type="text"
                      id="state"
                      name="state"
                      value={formData.state}
                      onChange={handleInputChange}
                      className="form-input"
                    />
                  </div>
                  <div className="form-group">
                    <label htmlFor="zipCode">Zip Code</label>
                    <input
                      type="text"
                      id="zipCode"
                      name="zipCode"
                      value={formData.zipCode}
                      onChange={handleInputChange}
                      className="form-input"
                    />
                  </div>
                </div>
              </div>

              <div className="form-section">
                <h2 className="section-title">Property Specifics</h2>
                <div className="form-grid">
                  <div className="form-group">
                    <label htmlFor="propertyType">Property Type</label>
                    <select
                      id="propertyType"
                      name="propertyType"
                      value={formData.propertyType}
                      onChange={handleInputChange}
                      className="form-select"
                    >
                      <option value="">Select Property Type</option>
                      <option value="Office">Office</option>
                      <option value="Warehouse">Warehouse</option>
                      <option value="Retail">Retail</option>
                      <option value="Land">Land</option>
                      <option value="Mixed-Use">Mixed-Use</option>
                      <option value="Industrial">Industrial</option>
                    </select>
                  </div>
                  <div className="form-group">
                    <label htmlFor="size">Size (sq ft)</label>
                    <input
                      type="text"
                      id="size"
                      name="size"
                      value={formData.size}
                      onChange={handleInputChange}
                      className="form-input"
                    />
                  </div>
                  <div className="form-group">
                    <label htmlFor="floors">Number of Floors</label>
                    <input
                      type="number"
                      id="floors"
                      name="floors"
                      value={formData.floors}
                      onChange={handleInputChange}
                      className="form-input"
                    />
                  </div>
                  <div className="form-group">
                    <label htmlFor="yearBuilt">Year Built</label>
                    <input
                      type="number"
                      id="yearBuilt"
                      name="yearBuilt"
                      value={formData.yearBuilt}
                      onChange={handleInputChange}
                      className="form-input"
                    />
                  </div>
                  <div className="form-group">
                    <label htmlFor="zoning">Zoning</label>
                    <input
                      type="text"
                      id="zoning"
                      name="zoning"
                      value={formData.zoning}
                      onChange={handleInputChange}
                      className="form-input"
                    />
                  </div>
                  <div className="form-group">
                    <label htmlFor="parkingSpaces">Parking Spaces</label>
                    <input
                      type="number"
                      id="parkingSpaces"
                      name="parkingSpaces"
                      value={formData.parkingSpaces}
                      onChange={handleInputChange}
                      className="form-input"
                    />
                  </div>
                </div>
              </div>

              <div className="form-section">
                <h2 className="section-title">Amenities</h2>
                <div className="amenities-grid">
                  <label className="checkbox-label">
                    <input
                      type="checkbox"
                      checked={formData.amenities.hvac}
                      onChange={() => handleAmenityChange('hvac')}
                    />
                    HVAC
                  </label>
                  <label className="checkbox-label">
                    <input
                      type="checkbox"
                      checked={formData.amenities.securitySystem}
                      onChange={() => handleAmenityChange('securitySystem')}
                    />
                    Security System
                  </label>
                  <label className="checkbox-label">
                    <input
                      type="checkbox"
                      checked={formData.amenities.loadingDocks}
                      onChange={() => handleAmenityChange('loadingDocks')}
                    />
                    Loading Docks
                  </label>
                  <label className="checkbox-label">
                    <input
                      type="checkbox"
                      checked={formData.amenities.highCeilings}
                      onChange={() => handleAmenityChange('highCeilings')}
                    />
                    High Ceilings
                  </label>
                  <label className="checkbox-label">
                    <input
                      type="checkbox"
                      checked={formData.amenities.renovated}
                      onChange={() => handleAmenityChange('renovated')}
                    />
                    Renovated
                  </label>
                </div>
              </div>

              <div className="form-section">
                <h2 className="section-title">Pricing</h2>
                <div className="form-group">
                  <label htmlFor="askingPrice">Asking Price/Rent</label>
                  <input
                    type="text"
                    id="askingPrice"
                    name="askingPrice"
                    value={formData.askingPrice}
                    onChange={handleInputChange}
                    className="form-input"
                  />
                  <div className="price-type-buttons">
                    <button
                      type="button"
                      className={`price-type-btn ${formData.priceType === 'sale' ? 'active' : ''}`}
                      onClick={() => handlePriceTypeChange('sale')}
                    >
                      Sale Price
                    </button>
                    <button
                      type="button"
                      className={`price-type-btn ${formData.priceType === 'rental' ? 'active' : ''}`}
                      onClick={() => handlePriceTypeChange('rental')}
                    >
                      Rental Price
                    </button>
                  </div>
                </div>
              </div>

              <div className="form-section">
                <h2 className="section-title">Description</h2>
                <div className="form-group">
                  <label htmlFor="description">Description</label>
                  <textarea
                    id="description"
                    name="description"
                    value={formData.description}
                    onChange={handleInputChange}
                    className="form-textarea"
                    placeholder="Enter property description..."
                    rows="4"
                  />
                </div>
              </div>

              <div className="form-section">
                <h2 className="section-title">Status</h2>
                <div className="form-group">
                  <label htmlFor="status">Status</label>
                  <select
                    id="status"
                    name="status"
                    value={formData.status}
                    onChange={handleInputChange}
                    className="form-select"
                  >
                    <option value="">Select Status</option>
                    <option value="Active">Active</option>
                    <option value="Pending">Pending</option>
                    <option value="Sold">Sold</option>
                    <option value="Under Contract">Under Contract</option>
                  </select>
                </div>
              </div>

              <div className="form-section">
                <h2 className="section-title">Property Images</h2>
                <div className="form-group">
                  {/* Existing Images */}
                  {uploadedImages.length > 0 && (
                    <div className="existing-images">
                      <h3 className="subsection-title">Current Images</h3>
                      <div className="image-grid">
                        {uploadedImages.map((image) => (
                          <div key={image.id} className="existing-image-item">
                            <img
                              src={image.url}
                              alt={image.name}
                              className="existing-image"
                            />
                            <div className="image-overlay">
                              <button
                                type="button"
                                className="remove-image-btn"
                                onClick={() => handleRemoveExistingImage(image.id)}
                              >
                                
                              </button>
                            </div>
                            <span className="image-name">{image.name}</span>
                          </div>
                        ))}
                      </div>
                    </div>
                  )}

                  {/* Upload New Images */}
                  <div className="image-upload-area">
                    <div className="upload-instructions">
                      Drag and drop or click to upload new images
                    </div>
                    <input
                      type="file"
                      multiple
                      accept="image/*"
                      onChange={handleImageUpload}
                      className="file-input"
                      id="imageUpload"
                    />
                    <label htmlFor="imageUpload" className="upload-button">
                      Upload New Images
                    </label>
                  </div>

                  {/* New Images Preview */}
                  {newImages.length > 0 && (
                    <div className="new-images">
                      <h3 className="subsection-title">New Images</h3>
                      <div className="image-grid">
                        {newImages.map((file, index) => (
                          <div key={index} className="new-image-item">
                            <img
                              src={URL.createObjectURL(file)}
                              alt={`New ${index + 1}`}
                              className="new-image"
                            />
                            <span className="image-name">{file.name}</span>
                          </div>
                        ))}
                      </div>
                    </div>
                  )}
                </div>
              </div>

              <div className="form-actions">
                <button type="button" className="btn-cancel" onClick={handleCancel}>
                  Cancel
                </button>
                <button type="submit" className="btn-save">
                  Save Changes
                </button>
              </div>
            </form>
          </div>
        </main>
      </div>
      <Footer />
    </div>
  );
};

export default EditListing;
